		      TweenMax.to('.first', 0.2, {
		        x: 0,
		        ease: Sine.easeIn
		      })
		      TweenMax.to('.last', 0.2, {
		        x: 0,
		        ease: Sine.easeIn
		      })
		      TweenMax.to('.first, .middle, .last', 0.2, {
		        fill: '#000'
		      })
		    }
		},
